@font-face {
    font-family: TTCommons;
    src: url(../static/regular.woff);
    font-weight:500;
    font-style: normal;
}

@font-face {
    font-family: TTCommons;
    src: url(../static/semibold.woff);
    font-weight: 600;
    font-style: normal;
}
@font-face {
    font-family: TTCommons;
    src: url(../static/bold.woff);
    font-weight: 700;
    font-style: normal;
}
